import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { FiLogOut, FiPlusCircle, FiSearch, FiUser, FiLayers, FiCompass, FiHome } from "react-icons/fi";

function Dashboard() {
  const [user, setUser] = useState(null);
  const [skills, setSkills] = useState([]);
  const [search, setSearch] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    } else {
      fetchUserProfile(token);
      fetchSkills();
    }
  }, []);

  const fetchUserProfile = async (token) => {
    try {
      const response = await fetch("http://localhost:5000/api/auth/profile", {
        method: "GET",
        headers: { Authorization: `Bearer ${token}` },
      });
      const data = await response.json();
      if (response.ok) {
        setUser(data);
      } else {
        alert("Session expired! Please log in again.");
        localStorage.removeItem("token");
        navigate("/login");
      }
    } catch (error) {
      console.error("Error fetching user profile:", error);
    }
  };

  const fetchSkills = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/skills");
      const data = await response.json();
      setSkills(data);
    } catch (error) {
      console.error("Error fetching skills:", error);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <div className="w-64 bg-white shadow-lg p-5 flex flex-col">
        <h2 className="text-2xl font-bold text-purple-700 mb-6 flex items-center">
          <FiLayers className="mr-2" /> Dashboard
        </h2>
        <nav className="flex flex-col space-y-4">
          <button onClick={() => navigate("/")} className="flex items-center p-3 rounded-lg hover:bg-purple-100">
            <FiHome className="mr-3" /> Home
          </button>
          <button onClick={() => navigate("/profile")} className="flex items-center p-3 rounded-lg hover:bg-purple-100">
            <FiUser className="mr-3" /> Profile
          </button>
          <button onClick={() => navigate("/explore")} className="flex items-center p-3 rounded-lg hover:bg-purple-100">
            <FiCompass className="mr-3" /> Explore
          </button>
          <button onClick={handleLogout} className="flex items-center p-3 rounded-lg text-red-500 hover:bg-red-100">
            <FiLogOut className="mr-3" /> Logout
          </button>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 flex flex-col p-6">
        {/* Header Section */}
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-2xl font-semibold text-purple-700">Welcome, {user?.name || "User"}!</h2>
          <input
            type="text"
            placeholder="Search skills..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="border p-2 rounded-md w-1/3 focus:ring-2 focus:ring-purple-400"
          />
        </div>

        {/* Home Page Options */}
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 mb-6">
          <div
            className="bg-white shadow-lg rounded-lg p-6 cursor-pointer hover:shadow-xl transition duration-300"
            onClick={() => navigate("/")}
          >
            <div className="flex items-center space-x-4">
              <FiHome className="text-4xl text-purple-600" />
              <h3 className="text-xl font-bold text-gray-800">Home</h3>
            </div>
          </div>
          <div
            className="bg-white shadow-lg rounded-lg p-6 cursor-pointer hover:shadow-xl transition duration-300"
            onClick={() => navigate("/profile")}
          >
            <div className="flex items-center space-x-4">
              <FiUser className="text-4xl text-purple-600" />
              <h3 className="text-xl font-bold text-gray-800">Profile</h3>
            </div>
          </div>
          <div
            className="bg-white shadow-lg rounded-lg p-6 cursor-pointer hover:shadow-xl transition duration-300"
            onClick={() => navigate("/explore")}
          >
            <div className="flex items-center space-x-4">
              <FiCompass className="text-4xl text-purple-600" />
              <h3 className="text-xl font-bold text-gray-800">Explore</h3>
            </div>
          </div>
          <div
            className="bg-white shadow-lg rounded-lg p-6 cursor-pointer hover:shadow-xl transition duration-300"
            onClick={handleLogout}
          >
            <div className="flex items-center space-x-4">
              <FiLogOut className="text-4xl text-red-500" />
              <h3 className="text-xl font-bold text-gray-800">Logout</h3>
            </div>
          </div>
        </div>

        {/* Skills Section */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h3 className="text-xl font-bold text-purple-700 mb-4">Your Skills</h3>
          {skills.length > 0 ? (
            <ul className="list-disc ml-6">
              {skills.map((skill) => (
                <li key={skill._id} className="text-gray-600">
                  {skill.name} ({skill.hoursAvailable} hours)
                </li>
              ))}
            </ul>
          ) : (
            <p className="text-gray-500">No skills added yet.</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
